Testing Our Dapp To run tests for our 'votingdapp', we need to install an npm tool called Anchor Bankrun, which is a testing framework that allows us to test our smart contract methods / instructions to make sure that our expected values occurs. You can jump to a summary of testing Solana Dapps in general. Jump to the key notes here 1 Install anchor-bankrun You can use either Yarn or Npm to install anchor-bankrun (provided that you do not have it installed already; check the ending part of this section to know whether or not you already. have anchor-bankrun installed). Now make sure to cd into your dapp project's directory before running any one of the commands below: For Yarn: yarn add anchor-bankrun For Npm: npm install anchor-bankrun The installation command for Anchor bankrun is: npm install anchor-bankrun It is very likely that you already have it installed, especially if you used command $: npx create-solana-dapp to generate a starter template for your project. Please Note: All the tests done in this page utilizes anchor-bankrun instead of the local validator. 2 Locate and edit your 'votingdapp.spec.ts' file This file can be found inside your project's anchor - tests folder. Open your votingdapp.spect.ts file and clear most of the code that already exists inside it such that it now looks like this: import * as anchor from '@coral-xyz/anchor';
import { Program } from '@coral-xyz/anchor';
import { Keypair } from '@solana/web3.js';
import { Votingdapp } from '../target/types/votingdapp'; describe('votingdapp', () => { // 'votingdapp' is just called 'voting' in the bootcamp's demo it('Initialize Poll', async () => { // ... });
}); In the bootcamp course video, the describe function above has a first argument string value of 'voting' instead of 'votingdapp' (used in this guide book) - please note the slight difference. 3 Choose the target smart contract program to test Each $: anchor build command compiles your project into a Solana binary that looks similar to this - <your-project-name>.so. This file is essentially the binary file we want to test each time we add new features to our dapp and rebuild it. We need to first copy the generated votingdapp.so binary file of our 'votingdapp'. The votingdapp.so file can be located inside the anchor - target - deploy folder of our project's directory. Paste this file. Next, paste the copied votingdapp.so binary file into the anchor - tests - fixtures folder. You may have to create a new fixtures folder if it does not already exist inside the tests folder. Please note that you will need to repeat this everytime you add new features to your program and want to test the new build of your program. 4 Integrate your IDL file into your dapp's .spec.ts code. An IDL is an interface to help build and generate language-specific format for calling smart contracts similar to Ethereum's ABI. The idl for our Solana dapp can be found inside the anchor - target - idl folder. For our votingdapp dapp (in this written guide), the idl file is named votingdapp.json, whereas in the bootcamp course video, this file is called voting.json - please note the name difference. To integrate the idl into our previously edited votingdapp.spec.ts code , add the following require statement to votingdapp.spec.ts's code: import * as anchor from '@coral-xyz/anchor';
import { Program } from '@coral-xyz/anchor';
import { Keypair } from '@solana/web3.js';
import { Votingdapp } from '../target/types/votingdapp'; const IDL = require('../target/idl/votingdapp.json'); describe('votingdapp', () => { it('Initialize Poll', async () => { // ... });
}); 5 Import program type 'Votingdapp' into your .spec.ts test file: This part has already been done for us. Do it manually if that is not the case for you: ... import { Votingdapp } from '../target/types/votingdapp'; ... In the bootcamp's video course, the specific object imported was Voting instead of Votingdapp, so please take note of this slight difference. 6 Declare your program address (PubKey) inside votingdapp.spec.ts The pub-key of our 'votingdapp' will be provided as part of the second argument of the startAnchor function's extraPrograms array-parameter. extraPrograms here will be an array that contains just one object. By now your 'votingdapp' program will have a pubkey. Simply go to the anchor - programs - src folder and grab the string inside declare_id!(""), and use it to create a new votingdappAddress' PublicKey constant like so: // imports
... // IDL
... const votingdappAddress = new PublicKey("AsjZ3kWAUSQRNt2pZVeJkywhZ6gpLpHZmJjduPmKZDZZ"); // describe
describe('votingdapp' () => { ...
}); 7 Create the Context and Provider for the Initialize_Poll instruction integration test case: The first program instruction in our votingdapp to be tested is in our votingdapp.spec.ts is Initialize_Poll. We need to provide a context and provider for an integration test using modules startAnchor and BankrunProvider respectively. // imports
... // IDL
... // votingdappAddress PublicKey
... describe('votingdapp', () => { it('Initialize Poll', async () => { const context = await startAnchor( '', [], [] ); const provider = new BankrunProvider(context); });
}); Creating the Context and Provider allows us to interact with our smart contract. startAnchor comes from the solana-bankrun Node module, which is pre-installed. BankrunProvider comes from the anchor-bankrun Node module, which should come pre-installed. You may find that your IDL automatically import BankrunProvider and startAnchor for you from NPM package anchor-bankrun. You may leave it as is because it would not affect your tests. Your votingdapp.spec.ts should now look like this: import * as anchor from '@coral-xyz/anchor';
import { Program } from '@coral-xyz/anchor';
import { Keypair } from '@solana/web3.js';
import { Votingdapp } from '../target/types/votingdapp';
//import { BankrunProvider, startAnchor } from 'anchor-bankrun';
import { startAnchor } from 'solana-bankrun';
import { BankrunProvider } from 'anchor-bankrun'; const IDL = require('../target/idl/votingdapp.json'); describe('votingdapp', () => { it('Initialize Poll', async () => { const context = await startAnchor('', [], []); // its first arg specifies the path of the 'tests' folder which is local in most cases, hence the empty string value const provider = new BankrunProvider(context); });
}); 8 Provide 'startAnchor()'-context an extraPrograms object-value as the only array item for startAnchor()'s second argument Your extraPrograms array-parameter will contain just a single object value that has a signature of - {name: '<your-program-name-in-lowecase-characters', programId: <your-program-address>}. Your votingdapp.spec.ts code should now look similar to this: import * as anchor from '@coral-xyz/anchor';
import { Program } from '@coral-xyz/anchor';
import { Keypair, PublicKey } from '@solana/web3.js';
import { Votingdapp } from '../target/types/votingdapp';
//import { BankrunProvider, startAnchor } from 'anchor-bankrun';
import { startAnchor } from 'solana-bankrun';
import { BankrunProvider } from 'anchor-bankrun'; const IDL = require('../target/idl/votingdapp.json'); const votingdappAddress = new PublicKey( 'AsjZ3kWAUSQRNt2pZVeJkywhZ6gpLpHZmJjduPmKZDZZ'
); describe('votingdapp', () => { it('Initialize Poll', async () => { const context = await startAnchor( '', [{ name: 'votingdapp', programId: votingdaapAddress }], // code update [] ); const provider = new BankrunProvider(context); });
}); 9 Create the Program object inside your it (integration test) function This is where we would bring in our program type Votingdapp that was imported here , and pass-in the IDL and provider constants created here and here , respectively. This is what the code to create the Program object looks like: // imports
... // IDL
... // votingdappAddress PublicKey
... describe('votingdapp' () => { it('Initialize Poll' async () => { // 'startAnchor()'-context ... // BankrunProvider(context) provider ... const votingdappProgram = new Program<Votingdapp>( IDL, provider ) });
}); Your entire votingdapp.spec.ts code should now look like this: import * as anchor from '@coral-xyz/anchor';
import { Program } from '@coral-xyz/anchor';
import { Keypair, PublicKey } from '@solana/web3.js';
import { Votingdapp } from '../target/types/votingdapp';
//import { BankrunProvider, startAnchor } from 'anchor-bankrun';
import { startAnchor } from 'solana-bankrun'; // 'startAnchor' can also be imported from 'anchor-bankrun' just like in the above comment
import { BankrunProvider } from 'anchor-bankrun'; const IDL = require('../target/idl/votingdapp.json'); const votingdappAddress = new PublicKey( 'AsjZ3kWAUSQRNt2pZVeJkywhZ6gpLpHZmJjduPmKZDZZ'
); describe('votingdapp', () => { it('Initialize Poll', async () => { const context = await startAnchor( '', [{ name: 'votingddapp', programId: votingdappAddress }], [] ); const provider = new BankrunProvider(context); const votingdappProgram = new Program<Votingdapp>(IDL, provider); });
}); 10 Interact with our 'votingdappProgram' instructions using the IDL To do this, we would simply await a call to votingProgram.method.<our-choice-instruction-to-test>. We need to make sure to with provide the values needed for ' method signature, for example, the initialize_poll instruction handler function inside our program has this method signature: ...
pub fn initialize_poll( ctx: <InitializePoll>, poll_id: u64, description: String, poll_start: u64, poll_end: u64,
) -> Result<()> { // ... function body ...
}
... Hence the IDL interaction for it is as follows: /* votingdapp.spec.ts
*/ // imports
... // IDL
... // votingdappAddress: PublicKey("")
... describe('votingdapp', () => { it('Initialize Poll', async () => { // startAnchor()-context ... // BankrunProvider(context)-provider ... // initializePoll is for our `iniitialize poll` it() function for our smart-contract / program's votingdapp.spec.ts await votingdappProgram.methods.initializePoll( new anchor.BN(1), // BN is how we create a u64 in TypeScript "What is your favorite type of peanut butter", new anchor.BN(0), new anchor.BN(1821246480), ) .rpc(); // the rpc() call executes the instruction within our program });
}); Your votingdapp.spec.ts should now look similar to this: import * as anchor from '@coral-xyz/anchor';
import { Program } from '@coral-xyz/anchor';
import { Keypair, PublicKey } from '@solana/web3.js';
import { Votingdapp } from '../target/types/votingdapp';
import { BankrunProvider, startAnchor } from 'anchor-bankrun';
//import { startAnchor } from 'solana-bankrun';
//import { BankrunProvider } from 'anchor-bankrun'; const IDL = require('../target/idl/votingdapp.json'); const votingdappAddress = new PublicKey( 'AsjZ3kWAUSQRNt2pZVeJkywhZ6gpLpHZmJjduPmKZDZZ'
); describe('votingdapp', () => { it('Initialize Poll', async () => { const context = await startAnchor( '', [{ name: 'votingdapp', programId: votingdappAddress }], [] ); const provider = new BankrunProvider(context); const votingdappProgram = new Program<Votingdapp>(IDL, provider); await votingdappProgram.methods .initializePoll( new anchor.BN(1), 'What is your favorite type of peanut butter', new anchor.BN(0), new anchor.BN(1821246680) ) .rpc(); });
}); 11 Verify your Anchor.toml's "[programs.localnet]" attribute key matches the name of your .spec.ts file: Your Anchor.toml file can be found inside the anchor folder inside your dapp project's working directory. Open this file make sure that your [programs.localnet] attribute's key has the correct name that matches your .spec.ts file. In our case it is votingdapp. You can find the [programs.localnet] attribute on line-8 of your Anchor.toml file. If you have been following the naming convention used in this guide, then your [programs.localnet] key should be called votingdapp. If you named things as done in the bootcamp's course video it would be voting instead. 12 Run the anchor test command: You can simply run the command provided below if you do not currently have the solana-test-validator running in the background because the anchor test command would fire up solana-test-validator. anchor test --skip-deploy If you already have solana-test-validator running then you need to use this command instead to skip the anchor test command from also running the solana-test-validator tool: anchor test --skip-local-validator --skip-deploy You should now see some tests passed similar to what I had here: A screenshot of $: anchor test --skip-deploy command's ouput result Writing actual tests for our 'votingdapp' The above .spec.ts file doesn't actually test anything, it merely gave us the setup to do tests, using the initial_poll integration test as an example to do dapp tests. Lets now continue working on the initial_poll it()-test example. You see, your Solana program is not the only thing that has an address, an Account also has its own address, something we would need to use in order to actually write proper tests. To test any Solana instruction in '.spec.ts': Pull the address of the Account-context used in your target instruction (function) that you wish to test. For example, in our Votingdapp program's case where we wished to test the intialize_poll instruction (function) that used the IntializePoll Account-context ~ PollAccount account, we had to first pull the address of the InitializePoll Account itself, using our Votingdapp program's address like this: /* votingdapp.spec.ts
*/ // imports
... // IDL
... // votingdappAddress: PublicKey("")
... describe('votingdapp', () => { it('Initialize Poll', async () => { // startAnchor()-context ... // BankrunProvider(context)-provider ... // votingdappProgram.methods.initializePoll instruction invocation ... const [pollAddress] = PublicKey.findProgramAddressSync( // Grab the buffer from a u64 [new anchor.BN(1).toArrayLike(Buffer, 'le', 8)], votingdappAddress // our Votingdapp program address ) });
}); Good to know 1: How does a test function know the correct Account address to pull? An Account's seeds is exactly how an integration test function knows the correct Account address to pull. The test function examines the array-items you provide to PublicKey.findProgramAddressSync([], <your-dapp-address>) and then finds the Account that best match the array items in a given Account's seed requirements specifed in the Account's #[instruction(<one-or-more-seeds>)]. The it() test function must also have a name that matches the Account's name (ignoring white-spaces and the character-casing). Inside your target it()-test function, you (may) then need to fetch the [account](s) inside the Account which you want to test, by using the Account's address to locate the Account and reference one or more [accounts] specified in the Account, for example: /* votingdapp.spec.ts
*/ // imports
... // IDL
... // votingdappAddress: PublicKey("")
... describe('votingdapp', () => { it('Initialize Poll', async () => { // startAnchor()-context ... // BankrunProvider(context)-provider ... // votingdappProgram.methods.initializePoll instruction invocation ... // PublicKey.findProgramAddressSync(...)-pollAddress ... const poll = await votingdappProgram.account.poll.fetch(pollAddress); });
}); Our votingdapp.spec.ts should look like this for now: import * as anchor from '@coral-xyz/anchor';
import { Program } from '@coral-xyz/anchor';
import { Keypair, PublicKey } from '@solana/web3.js';
import { Votingdapp } from '../target/types/votingdapp';
import { BankrunProvider, startAnchor } from 'anchor-bankrun';
//import { startAnchor } from 'solana-bankrun';
//import { BankrunProvider } from 'anchor-bankrun'; const IDL = require('../target/idl/votingdapp.json'); const votingdappAddress = new PublicKey( 'AsjZ3kWAUSQRNt2pZVeJkywhZ6gpLpHZmJjduPmKZDZZ'
); describe('votingdapp', () => { it('Initialize Poll', async () => { const context = await startAnchor( '', [{ name: 'votingdapp', programId: votingdappAddress }], [] ); const provider = new BankrunProvider(context); const votingdappProgram = new Program<Votingdapp>(IDL, provider); await votingdappProgram.methods .initializePoll( new anchor.BN(1), 'What is your favorite type of peanut butter', new anchor.BN(0), new anchor.BN(1821246680) ) .rpc(); const [pollAddress] = PublicKey.findProgramAddressSync( // Grab the buffer from a u64 [new anchor.BN(1).toArrayLike(Buffer, 'le', 8)], votingdappAddress // our Votingdapp program address ); const poll = await votingdappProgram.account.poll.fetch(pollAddress); // Think of poll has our direct access to data inside PollAccount' account });
}); We can even log an [account] that is inside an Account-context, e.g log [account] Poll inside Account-context InitializePoll. Let us add expects for an [account] (in this case [account] Poll) to our 'Initialize Poll' integration test function: /* votingdapp.spec.ts
*/ // imports
... // IDL
... // votingdappAddress: PublicKey("")
... describe('votingdapp', () => { // let context, provider, votingdappProgram ... // beforeAll(async() => {...}) ... it('Initialize Poll' async () => { // context: startAnchor() ... // provider: Bankrun(Provider(context) ... // votingdappProgram: Program<Votingdapp> ... // await votingdappProgram.methods.initializePoll(...).rpc(); ... // [pollAddress]: PublicKey.findProgramAddressSync(...) ... const poll = await votingdappProgram.account.poll.fetch(pollAddress); console.log(poll); expect(poll.pollId.toNumber()).toEqual(1); expect(poll.description).toEqual('What is your favorite peanut butter'); expect(poll.pollStart.toNumber()).toBeLessThan(poll.pollEnd.toNumber()); })
}); Now let's make 'votingdapp.spec.ts' better: We can introduce a beforeAll() method that runs before any of our it() test function and simply instantiates variables we'll re-use in various it() functions, just once. It also makes votingdapp.spec.ts more compact. Here's what that looks like: import * as anchor from '@coral-xyz/anchor';
import { Program } from '@coral-xyz/anchor';
import { Keypair, PublicKey } from '@solana/web3.js';
import { Votingdapp } from '../target/types/votingdapp';
import { BankrunProvider, startAnchor } from 'anchor-bankrun';
//import { startAnchor } from 'solana-bankrun';
//import { BankrunProvider } from 'anchor-bankrun'; const IDL = require('../target/idl/votingdapp.json'); const votingdappAddress = new PublicKey( 'AsjZ3kWAUSQRNt2pZVeJkywhZ6gpLpHZmJjduPmKZDZZ'
); describe('votingdapp', () => { let context; let provider; let votingdappProgram: Program<Votingdapp>; beforeAll(async () => { context = await startAnchor( '', [{ name: 'votingdapp', programId: votingdappAddress }], [] ); provider = new BankrunProvider(context); votingdappProgram = new Program<Votingdapp>(IDL, provider); }); it('Initialize Poll', async () => { await votingdappProgram.methods .initializePoll( new anchor.BN(1), 'What is your favorite type of peanut butter', new anchor.BN(0), new anchor.BN(1821246680) ) .rpc(); const [pollAddress] = PublicKey.findProgramAddressSync( // Grab the buffer from a u64 [new anchor.BN(1).toArrayLike(Buffer, 'le', 8)], votingdappAddress // our Votingdapp program address ); const poll = await votingdappProgram.account.poll.fetch(pollAddress); // Think of poll has our direct access to data inside PollAccount' account console.log(poll); expect(poll.pollId.toNumber()).toEqual(1); expect(poll.description).toEqual( 'What is your favorite type of peanut butter' ); expect(poll.pollStart.toNumber()).toBeLessThan(poll.pollEnd.toNumber()); });
}); Integration tests for instruction 'initialize_candidate' in our 'votingdapp' Program: // 'votingdapp.spec.ts': // imports
... // IDL
... // votingdappAddress: PublicKey("")
... describe('votingdapp', () => { // let context, provider, votingdappProgram ... // beforeAll(async() => {...}) ... // it('Initialize Poll', async () => {...}); ... it('initialize candidate', async () => { await votingdappProgram.methods .initializeCandidate('Smooth', new anchor.BN(1)) .rpc(); await votingdappProgram.methods .initializeCandidate('Smooth', new anchor.BN(1)) .rpc(); const [crunchyAddress] = PublicKey.findProgramAddressSync( [ new anchor.BN(1).toArrayLike(Buffer, 'le', 8), Buffer.from('Crunchy'), ], votingdappAddress, ); const crunchyCandidate = await votingdappProgram.account.candidate.fetch(crunchyAddress); console.log(crunchyCandidate); expect(crunchyCandidate.candidateVotes.toNumber()).toEqual(0); const [smoothAddress] = PublicKey.findProgramAddressSync( [ new anchor.BN(1).toArrayLike(Buffer, 'le', 8), Buffer.from('Smooth'), ], votingdappAddress, ); const smoothCandidate = await votingdappProgram.account.candidate.fetch(smoothAddress); console.log(smoothCandidate); expect(smoothCandidate.candidateVotes.toNumber()).toEqual(0); })
}); Good to know 2: In the code snippet above, pay attention to the initializeCandidate(...) method. Two things must hold true in its await votingdappProgram.methods.initializeCandidate(...).rpc(); call to make the test work. Firstly, its name - initializeCandidate must match the instruction (function) we want to test which in the above example's case was initialize_candidate (ignoring the underscore _ character and the letter-casing). Secondly, the arguments passed-in to initializeCandidate(...) must fulfill the requirement of the instruction (function) initialize_candidate's Account-context which was - #[instruction(candidate_name: String, poll_id: u64)]. Good to know 3: Also in the test code snippet above, crunchyAddress was extracted with PublicKey.findProgramAddressSync([new anchor.BN(1).toArrayLike(Buffer, 'le', 8), Buffer.from('Crunchy')], votingdappAddress,). Pay attention to the argument passed as array-items to PublicKey.findProgramAddressSync(...)'s array argument - it must be in the order that you specify the seed for the [account] you are trying to extract inside an instruction's Account-context, an in the above example's case, the seed for [account] candidate was poll_id.to_le_bytes().as_ref(), candidate_name.as_bytes()]. Integration tests for instruction 'vote' in our 'votingdapp' Program: // 'votingdapp.spec.ts':
// imports
... // IDL
... // votingdappAddress: PublicKey("")
... describe('votingdapp', () => { // let context, provider, votingdappProgram ... // beforeAll(async() => {...}) ... // it('Initialize Poll', async () => {...}); ... it('vote', async () => { await votingdappProgram.methods .vote( "Smooth", new anchor.BN(1) ) .rpc(); const [smoothAddress] = PublicKey.findProgramAddressSync( [ new anchor.BN(1).toArrayLike(Buffer, 'le', 8), Buffer.from('Smooth') ], votingdappAddress, ); const smoothCandidate = await votingdappProgram.account.candidate.fetch(smoothAddress); console.log(smoothCandidate); expect(smoothCandidate.candidateVotes.toNumber()).toEqual(1); }) }); 'votingdapp.spec.ts': This is the final look of our votingdapp.spec.ts for this part of this guidebook: /*
vscode-remote://wsl%2Bubuntu-22.04/home/iodaps/solana-github/bootcamp-temp/voting-dapp/anchor/tests/votingdapp.spec.ts
*/ import * as anchor from '@coral-xyz/anchor';
import { Program } from '@coral-xyz/anchor';
import { Keypair, PublicKey } from '@solana/web3.js';
import { Votingdapp } from '../target/types/votingdapp';
import { BankrunProvider, startAnchor } from 'anchor-bankrun';
//import { startAnchor } from 'solana-bankrun';
//import { BankrunProvider } from 'anchor-bankrun'; const IDL = require('../target/idl/votingdapp.json'); const votingdappAddress = new PublicKey( 'AsjZ3kWAUSQRNt2pZVeJkywhZ6gpLpHZmJjduPmKZDZZ'
); describe('votingdapp', () => { let context; let provider; let votingdappProgram: Program<Votingdapp>; beforeAll(async () => { context = await startAnchor( '', [{ name: 'votingdapp', programId: votingdappAddress }], [] ); provider = new BankrunProvider(context); votingdappProgram = new Program<Votingdapp>(IDL, provider); }); // Test 1: it('Initialize Poll', async () => { await votingdappProgram.methods .initializePoll( new anchor.BN(1), 'What is your favorite type of peanut butter', new anchor.BN(0), new anchor.BN(1821246680) ) .rpc(); const [pollAddress] = PublicKey.findProgramAddressSync( // Grab the buffer from a u64 [new anchor.BN(1).toArrayLike(Buffer, 'le', 8)], votingdappAddress // our Votingdapp program address ); const poll = await votingdappProgram.account.poll.fetch(pollAddress); // Think of poll has our direct access to data inside PollAccount' account console.log(poll); expect(poll.pollId.toNumber()).toEqual(1); expect(poll.description).toEqual( 'What is your favorite type of peanut butter' ); expect(poll.pollStart.toNumber()).toBeLessThan(poll.pollEnd.toNumber()); }); // Test 2: it('Initialize Candidate', async () => { await votingdappProgram.methods .initializeCandidate('Smooth', new anchor.BN(1)) .rpc(); await votingdappProgram.methods .initializeCandidate('Crunchy', new anchor.BN(1)) .rpc(); const [crunchyAddress] = PublicKey.findProgramAddressSync( [new anchor.BN(1).toArrayLike(Buffer, 'le', 8), Buffer.from('Crunchy')], votingdappAddress ); const crunchyCandidate = await votingdappProgram.account.candidate.fetch( crunchyAddress ); console.log(crunchyCandidate); expect(crunchyCandidate.candidateVotes.toNumber()).toEqual(0); const [smoothAddress] = PublicKey.findProgramAddressSync( [new anchor.BN(1).toArrayLike(Buffer, 'le', 8), Buffer.from('Smooth')], votingdappAddress ); const smoothCandidate = await votingdappProgram.account.candidate.fetch( smoothAddress ); console.log(smoothCandidate); expect(smoothCandidate.candidateVotes.toNumber()).toEqual(0); }); // Test 3: it('vote', async () => { await votingdappProgram.methods.vote('Smooth', new anchor.BN(1)).rpc(); const [smoothAddress] = PublicKey.findProgramAddressSync( [new anchor.BN(1).toArrayLike(Buffer, 'le', 8), Buffer.from('Smooth')], votingdappAddress ); const smoothCandidate = await votingdappProgram.account.candidate.fetch( smoothAddress ); console.log(smoothCandidate); expect(smoothCandidate.candidateVotes.toNumber()).toEqual(1); });
}); Key Notes Writing Tests for Solana Dapps in General : Moving on, we should note the requirements for our <dapp>.spec.ts test file to work, namely; Your fixtures which is the binary file of your dapp. See Here Your IDL which is a JSON file that must be linked inside your <dapp>.spec.ts file. See Here Your Dapp's type which must be imported into your <dapp>.spec.ts file. See Here Your .spec.ts file with the basic import requirements: import * as anchor from '@coral-xyz/anchor';
import { Program } from '@coral-xyz/anchor';
import { Keypair, PublicKey } from '@solana/web3.js';
import { Ourdapp } from '../target/types/ourdapp';
import { BankrunProvider, startAnchor } from 'anchor-bankrun'; Some variables must be provided inside your dapp.spec.ts's describe() function, preferably inside a beforeAll() nested first inside our describe(). Here's an example: // imports
... const IDL = require('../target/idl/ourdapp.json'); const ourdappAddress = new PublicKey( 'AsjZ3kWAUSQRNt2pZVeJkywhZ6gpLpHZmJjduPmKZDZZ'
); describe('ourdapp', () => { let context; let provider; let ourdappProgram: Program<Ourdapp>; beforeAll(async () => { context = await startAnchor( '', [{ name: 'ourdapp', programId: ourdappAddress }], [] ); provider = new BankrunProvider(context); ourdappProgram = new Program<Ourdapp>(IDL, provider); }); it();
}); We also now know that inside each integration test / it() function, we need to: Use the PublicKey.findProgramAddressSync() function to find the address of the [account] transacted ( initialized or modified) through the Account-context of the instruction (function) we wish to test. Note that: You have to provide the appropriate seeds for the Account-context of the instruction (function) in the exact order specified inside the instruction (function) as array item(s) to PublicKey.findProgramAddressSync([...], <your-dapp-address-here>)'s arrray argument in the exact order specified in both the instruction-function and the Account, and then provide your dapp address as the second argument to PublicKey.findProgramAddressSync() as PublicKey.findProgramAddressSync([...], ourDappAddress). describe('ourdapp', () => { let context; let provider; let ourdappProgram; beforeAll(async () => { ... }); // it test for instruction-function `do_some_a` it('Do Some A Test', async () => { const [someAAddress] = PublicKey.findProgramAddressSync( [new anchor.BN(1).toArrayLike(Buffer, 'le', 8)], // The seeds for 'Some_A_Instruction 'Account'-context of the instruction-function we are testing ourdappAddress ); });
}); We can initialize values for the instruction handler that we wish to test. Here is an example code: describe('ourdapp', () => { let context; let provider; let ourdappProgram: Program<Ourdapp>; beforeAll(async () => { context = await startAnchor( '', [{ name: 'ourdapp', programId: ourdappAddress }], [] ); provider = new BankrunProvider(context); ourdappProgram = new Program<Ourdapp>(IDL, provider); }); // 'do_some_a' it test: it('Do Some A', async () => { // Get the address of Some_A '[account]' const [someAAddress] = PublicKey.findProgramAddressSync( ... ); // Initialize the values for 'Do_Some_A' Account await ourdappProgram.methods .initializeSomeA( new anchor.BN(1), new anchor.BN(0), new anchor.BN(1821246680) ) .rpc(); });
}); Fetch the actual [account] stored in our Instruction / Account, using the addess of the [account], e.g, the address of [account] - someAAdress: describe('ourdapp', () => { let context; let provider; let ourdappProgram: Program<Ourdapp>; beforeAll(async () => { context = await startAnchor( '', [{ name: 'ourdapp', programId: ourdappAddress }], [] ); provider = new BankrunProvider(context); ourdappProgram = new Program<Votingdapp>(IDL, provider); }); // Integration Test - 'Some Test A' it('Some A Test', async () => { // Get the address of Do_Some_A 'Account' const [doSomeAAddress] = PublicKey.findProgramAddressSync( [new anchor.BN(1).toArrayLike(Buffer, 'le', 8)], // The seeds for [account] 'Some_A' inside 'Some_A_Instruction 'Account' ourdappAddress ); // Initialize the values for some_a '[account]' inside DoSomeA 'Account' await ourdappProgram.methods .doSomeA(new anchor.BN(1), new anchor.BN(0), new anchor.BN(1821246680)) .rpc(); // Actual someA [account] initiated for testing purposes const accountSomeA = await ourdappProgram.account.some_a.fetch( someAAddress ); });
}); Timestamp - [1:13:46 - 1:27:09], [1:27:09 - 1:49:59]

15.body:
Add Blinks and Actions to'votingdapp' Developed Earlier Preparing the 'votingdapp' project for adding Blinks and Actions: On this page, we'll add Blinks and Actions to our previously created votingdapp project, and there is a lot of different amount of work that we'd have to do for Blinks and Actions. We will be referencing the Solana Actions and Blinks documentation page to prepare our votingdapp project for adding Blinks and Actions to it. 1 Deploy your dapp (e.g, 'votingdapp'): In the previous chapter ('Project 2: Voting Application'), we used anchor-bankrun to run tests in the Testing Dapps page. However, in this chapter, we will need the local test validator to test our dapp that has some UI bootstrap on top of it. Let us first go into our anchor folder and perfom an Anchor deploy operation. Now this might be different based off your Solana config, so actually, you might need to check your Solana config first with - $ solana config get. We need to set our config environment to local (RPC URL: http://localhost:8999). Set your Solana config environment to local if it isn't already set to local: solana config set -ul Now we can run the anchor deployment command: anchor deploy The above command will deploy your dapp project's binary, e.g, votingdapp.so. to the blockchain. If $: anchor deploy fails to work with an error message error sending request for url (http://127.0.01;8099): error trying to connect: tcp connect error: Connection refused (os error 111), then it means that your 'solana-test-validator' is not running. You can fix the error by just running $: solana-test-validator to start the 'solana-test-validator' which is a requirement to deploy your anchor smart contract locally. Upon starting the 'solana-test-validator', retry the $: anchor deploy command. Check your successfully deployed program at https://explorer.solana.com/ - switch from Mainnet Beta to Custom RPC URL, then copy, paste, and enter the Program Id displayed on your terminal into the search bar that has a placeholder text that says - Search for blocks, accounts, transactions, programs, and tokens. After successfully deploying your dapp to the local validator (using solana-test-validator), and searching for your dapps's Program Id on explorer.solana.com , you should see something somewhat similar to the following: Screenshot of explorer.solana.com votingdapp Program Id search Good to know 1: The solana-test-validator command when run for the first time, creates a new folder called test-ledger inside the working directory where the command is run. If you delete this folder and re-run the command, the folder will simply be recreated. 2 Install @solana/actions: Go into your project's root directory. If you currently inside the anchor directory, then you have to $ cd .. so you can be inside your project's root directory. Use the command below to install @solana/actions: NPM: npm install @solana/actions 3 Run your dapp Let us now run our votingdapp in dev mode: npm run dev 4 Create a GET request to get the right information to do our Actions: We need to structure our request in such a way that follows the guidelines specified in the Solana Actions documentation page' URL schema here - https://solana.com/docs/advanced/actions#url-scheme . We will write the URL Schema for our Actions inside a route.ts code-file located at - web - app - api. For you, the right folder may be src - app - api. Create a new sub-folder named votingdapp inside the api folder. Please note that in the bootcamp's video, the new folder was named voting instead of votingdapp. Now copy the route.ts code file inside .../api/hello into our previous created new .../api/votingdapp sub-folder. The copied route.ts files should have the following content: export async function GET(request: Request) { return new Response('Hello, from API!');
} You can check out the newly created route by opening localhost:3000/api/votingdapp. You will find the text Hello, from API! written on your screen. Good to know 2: The template we have chosen to build our dapp from spins up a basic NextJS server-side app for working with Blinks, which should be noted to be quite a heavy application for these Blinks. NextJS server side is quite heavy for this for this usage. It is recommended to use a Node JS server - like an Express server if you can. But because we have a scaffold and we will later on in the course build the actual frontend for the voting application, we are just going to use this backend and bootstrap it with this voting Action. 5 Return valuable information in order to display the Blink on any social media The expected metadata response after an Action client makes a GET request to an Action provider for its available Actions is a JSON body-payload that follows the specification of ActionGetResponse: export type ActionType = 'action' | 'completed'; export type ActionGetResponse = Action<'action'>; export interface Action<T extends ActionType> { /** type of Action to present to the user */ type: T; /** image url that represents the source of the action request */ icon: string; /** describes the source of the action request */ title: string; /** brief summary of the action to be performed */ description: string; /** button text rendered to the user */ label: string; /** UI state for the button being rendered to the user */ disabled?: boolean; links?: { /** list of related Actions a user could perform */ actions: LinkedAction[]; }; /** non-fatal error message to be displayed to the user */ error?: ActionError;
} Fields icon, title, description, and label are required. The remaining fields are optional. We will also need to provide CORS information. For now our api/votingdapp's route.ts now looks like this: import { ActionGetResponse } from '@solana/actions'; export async function GET(request: Request) { const actionMetadata: ActionGetResponse = { icon: 'https://zestfulkitchen.com/wp-content/uploads/2021/09/Peanut-butter_hero_for-web-2.jpg', title: 'Vote for your favorite type of peanut butter!', description: 'Vote between crunchy and smooth peanut butter', label: 'Vote', }; return Response.json(actionMetadata);
} Good to know 3: You can test your Blinks using the dial.to website. To use dial.to to test your Blinks, you'd include the localhost link to your Blink within the dial.to route, similar to this - https://dial.to/?action=solana-action:http://localhost:3000/api/<your-blink-here>. Make sure to avoid CORS related errors. Read the step 6 to know exactly how to prevent CORS-related errors that prevent your Blinks from loading when testing Blinks. 6 Check out your Blink visually using dial.to, and fix CORS errors In our case, we can use the dial.to website to have a visual representation of what our Blink looks like by using the this specific link - https://dial.to/?action=solana-action:http://localhost:3000/api/votingdapp. Upon visiting this link, you'd realise that the Blink actually fails to load and is thus, blank. That's because we are yet to fix CORS (Cross Origin Resource Sharing) requirement that your browser has in place to keep you safe online. dial.to Blink CORS error screenshot Let's fix the error by modifying our api/votingdapp/route.ts file: /* src/app/api/votingdapp/route.ts
*/ import { ActionGetResponse } from '@solana/actions'; export async function GET(request: Request) { const actionMetadata: ActionGetResponse = { icon: 'https://zestfulkitchen.com/wp-content/uploads/2021/09/Peanut-butter_hero_for-web-2.jpg', title: 'Vote for your favorite type of peanut butter!', description: 'Vote between crunchy and smooth peanut butter', label: 'Vote', }; return Response.json(actionMetadata);
} After making the above modifications, our Action can now be served by a Blink, and if you check our the link to our Blink using the appropriate dial.to link to our Blink, our Blink should now load. We get a warning that your Blink is not yet registered, and that's okay for us since we are just testing to make sure it works how we want it to for now. The warning is there to let you know Blinks that are known by a Blink registry. Using an unknown Blink is done at your own risk: Loaded but partially finished blink Alright, so now we at least have our Blink on display using dial.to, but our Blink can't post a voting Action. If you click the vote button, you will in fact get a CORS and POST network error. Good to know 4: Part of the whole system for onboarding Blinks as of the time of the bootcamp 2024, onto social-media, is that you have to actually get your Action registered via some kind of registry out there, e.g. Dialect. 7 Respond with metadata and available Actions Let's first prevent a CORS error when making a request inside our Blink e.g cliking the vote button to vote inside our votingdapp Blink rendered with dial.to. /* src/app/api/votingdapp/route.ts
*/ // imports
... export const OPTIONS = GET // export async function GET(request: Request)
... Next, we have to update the route.ts for our Blink with the correct LinkedAction metadata so we can showcase corresponding available Actions inside the Blink. The ActionGetResponse spec allows us to specify a LinkedAction value to its links? attribute which is what specifies a list of related Actions for a Blink user to possibly perform. For more details about LinkedActions spec, check this page of Solana docs . And since in our votingdapp, we would be performing one of two different post Actions to vote either Crunchy or Smooth, our ActionGetResponse' links field is specified as: ... links: { actions: [ { label: "Vote for Crunchy", href: "/api/vote?candidate=crunchy", type: "post", }, { label: "Vote for Smooth", href: "/api/vote?candidate=smooth", type: "post", } ]
} The route.ts for our votingdapp API now lookS like this after specifying a LinkedAction value for our ActionGetResponse' (GET Response body)links?: field: /* src/app/api/votingdapp/route.ts */ import { ActionGetResponse, ACTIONS_CORS_HEADERS } from '@solana/actions'; export const OPTIONS = GET; export async function GET(request: Request) { const actionMetadata: ActionGetResponse = { icon: 'https://zestfulkitchen.com/wp-content/uploads/2021/09/Peanut-butter_hero_for-web-2.jpg', title: 'Vote for your favorite type of peanut butter!', description: 'Vote between crunchy and smooth peanut butter', label: 'Vote', links: { actions: [ { label: 'Vote for Crunchy', href: '/api/vote?candidate=crunchy', type: 'post', }, { label: 'Vote for Smooth', href: '/api/vote?candidate=smooth', type: 'post', }, ], }, }; return Response.json(actionMetadata, { headers: ACTIONS_CORS_HEADERS });
} Side Note: Moving forward with this guidebook, it is assumed that you now have a Solana wallet. This guidebook makes use of the phantom wallet. Please go to the official Phantom website - https://phantom.com , and install the Phantom extention on your favorite browser(s). This guide also assumes that you created a seed phrase wallet. 8 Make a 'POST' request with the Blink user's wallet pubkey Let's now create a new function called POST for this purpose and learn what we need to include for our votingdapp to work. Inside this function, we will need to grab the URL from the request, and the search parameter inside the same URL. /* src/app/api/votingdapp/route.ts
*/ // imports
... ... export async function POST(request: Request) { const url = new URL(request.url); const candidate = url.searchParams.get("candidate");
} In our votingdapp, we need to make sure that the vote-candidate given is a valid candidate - 'Crunchy' or 'Smooth' without giving the user of the Blink a strange error in case someone enter a non-existing candidate. /* src/app/api/votingdapp/route.ts
*/ // imports
... // export async function GET(request: Request)
... export async function POST(request: Request) { const url = new URL(request.url); const candidate = url.searchParams.get("candidate"); if (candidate != "crunchy" && candidate != "smooth") { return new Response("Invalid candidate", { status: 400 }); }
} Create a connection to our local test validator. We need to provide a commitment status when you create a connection inside the POST function: /* src/app/api/votingdapp/route.ts
*/ // imports
... // export async function GET(request: Request)
... export async function POST(request: Request) { ... const connection = new Connection('http://127.0.0.1:8899', 'confirmed');
} Good to know 4: There are various commitment status levels such as; "process", "confirmed", "finalized". And they tell us how certain it is that a transaction would make it on the cluster. Commitment status level process says - hey, I found it, it's not yet confirmed. Commitment status level confirmed means - it's confirmed by 66% of the actual cluster. And then finalized says - it's confirmed by 66% and there's been 31 blocks afterwards that were also confirmed. finalized takes a lot longer, confirmed is generally safe - at the time of the bootcamp's recording, there's never been something that was confirmed that didn't make it to finalized. Alright, so next, let's grab the account that the user signed with on the Blink by copying the account address from the body of the POST request in our Blink made when we decided to vote for a candidate such as "Crunchy". In our case it is the public key tied to your wallet as seen below: POST payload to vote a candidate e.g Crunchy We would also gracefully handle the error case where the account provided/found is invalid: /* src/app/api/votingdapp/route.ts
*/ // imports
... // export async function GET(request: Request)
... export async function POST(request: Request) { ... const body: ActionPostRequest = await request.json; const voter = new PublicKey(body.account); let voter; try { voter = new PublicKey(body.account); } catch (error) { return new Response('Invalid account', { status: 400, headers: ACTIONS_CORS_HEADERS, }); }
} Create the transaction to send back after the POST request completes. In order to create transactions, we need a few things - a blockhash, a message, and any signatures that we possibly need to send to be added to that transaction. Fortunately for us in our votingdapp case though, we don't need any signatures on the server side because we don't care about signing anything on the server-side. Pull in our IDL and Votingdapp type into our route.ts file just like we had it earlier in our votingdapp.spec.ts file: /* src/app/api/votingdapp/route.ts
*/ // previous imports
... import { Votingdapp } from '@/../anchor/target/types/votingdapp'; const IDL = require('@/../anchor/target/idl/votingdapp.json'); ... Create a program provider. Note that unlike in our previous votingdapp.spec.ts test from Testing Dapps , we did not need to actually care to have a Bankrun provider because it was just a test. For our Blink program though, we need to make sure that we use the right Anchor provider in order to run our program on a specific POST request. Below is the code snippet const program: anchor.Program<Votingdapp> = new anchor.Program(IDL, { connection,
}); Our route.ts should now look like this: /* src/app/api/votingdapp/route.ts
*/ import { ActionGetResponse, ActionPostRequest, ACTIONS_CORS_HEADERS,
} from '@solana/actions';
import * as anchor from '@coral-xyz/anchor';
import { PublicKey } from '@solana/web3.js';
import { Votingdapp } from '@/../anchor/target/types/votingdapp'; const IDL = require('@/../anchor/target/idl/votingdapp.json'); export const OPTIONS = GET; export async function GET(request: Request) { const actionMetadata: ActionGetResponse = { icon: 'https://zestfulkitchen.com/wp-content/uploads/2021/09/Peanut-butter_hero_for-web-2.jpg', title: 'Vote for your favorite type of peanut butter!', description: 'Vote between crunchy and smooth peanut butter', label: 'Vote', links: { actions: [ { label: 'Vote for Crunchy', href: '/api/vote?candidate=Crunchy', type: 'post', }, { label: 'Vote for Smooth', href: '/api/vote?candidate=Smooth', type: 'post', }, ], }, }; return Response.json(actionMetadata, { headers: ACTIONS_CORS_HEADERS });
} export async function POST(request: Request) { const url = new URL(request.url); const candidate = url.searchParams.get('candidate'); if (candidate != 'crunchy' && candidate != 'smooth') { return new Response('Invalid candidate', { status: 400 }); } const connection = new anchor.web3.Connection( 'http://127.0.0.1:8899', 'confirmed' ); // Our provider : const program: anchor.Program<Votingdapp> = new anchor.Program(IDL, { connection, }); const body: ActionPostRequest = await request.json(); let voter; try { voter = new PublicKey(body.account); } catch (error) { return new Response('Invalid account', { status: 400, headers: ACTIONS_CORS_HEADERS, }); }
} In the case that const program: anchor.Program<Votingdapp> = new anchor.Program(IDL, { connection }); does not pass as valid code in your route.ts, then please update your next.config.mjs file in order for your code to compile properly. You can do a quick search online to find the fix. Now lets grab the instruction for voting for a candidate from inside our Blink, and in order to do this, we need the specific ID of the candidate we wish to vote for. /* src/app/api/votingdapp/route.ts
*/ ... export async function POST (request: Request) { ... const instruction = await program.methods.vote(candidate, new anchor.BN(1)) .accounts({ signer: voter, }) .instruction();
} Get a blockhash. We'll use a latest blockhash. It is to be noted that blockhases expire after a 150 confirmed blocks so if you try and use it and it is too late, it's gone - this is to prevent replay attacks on Solana. /* route.ts
*/ ... export async function POST (request: Request) { ... const blockhash = await connection.getLatestBlockhash()
} Now let's create our transaction and also specify our blockhash, fee payer, and what we are expecting inside our POST function. /* route.ts
*/ ... export async function POST (request: Request) { ... // const blockhash ... const transaction = new Transaction({ feePayer: voter, blockhash: blockhash.blockhash, lastValidBlockHeight: blockhash.lastValidBlockHeight, }).add(instruction);
} 9 Return the transaction as an actual response back to the user on the Blink When you do return a response, remember to include the ACTION_CORS_HEADERS with it. /* route.ts
*/ ... export async function POST (request: Request) { ... // const blockhash ... // const transaction ... const response = await createPostResponse({ fields: { transaction: transaction, type: "transaction" } }); return Response.json(response, { headers: ACTIONS_CORS_HEADERS })
} Our route.ts code should now look like this: import { ActionGetResponse, ActionPostRequest, ACTIONS_CORS_HEADERS, createPostResponse,
} from '@solana/actions';
import * as anchor from '@coral-xyz/anchor';
// import { BN } from '@coral-xyz/anchor';
import { PublicKey, Transaction } from '@solana/web3.js';
// import { Votingdapp } from "@project/anchor";
import { Votingdapp } from '@/../anchor/target/types/votingdapp'; //const IDL = require('../../../../anchor/tests/votingdapp.json')
const IDL = require('@/../anchor/target/idl/votingdapp.json'); export const OPTIONS = GET; export async function GET(request: Request) { const actionMetadata: ActionGetResponse = { icon: 'https://zestfulkitchen.com/wp-content/uploads/2021/09/Peanut-butter_hero_for-web-2.jpg', title: 'Vote for your favorite type of peanut butter!', description: 'Vote between crunchy and smooth peanut butter', label: 'Vote', links: { actions: [ { label: 'Vote for Crunchy', href: '/api/vote?candidate=Crunchy', type: 'post', }, { label: 'Vote for Smooth', href: '/api/vote?candidate=Smooth', type: 'post', }, ], }, }; return Response.json(actionMetadata, { headers: ACTIONS_CORS_HEADERS });
} export async function POST(request: Request) { const url = new URL(request.url); const candidate = url.searchParams.get('candidate'); if (candidate != 'Crunchy' && candidate != 'Smooth') { return new Response('Invalid candidate', { status: 400 }); } const connection = new anchor.web3.Connection( 'http://127.0.0.1:8899', 'confirmed' ); const program: anchor.Program<Votingdapp> = new anchor.Program(IDL, { connection, }); const body: ActionPostRequest = await request.json(); let voter; try { voter = new PublicKey(body.account); } catch (error) { return new Response('Invalid account', { status: 400, headers: ACTIONS_CORS_HEADERS, }); } const instruction = await program.methods .vote(candidate, new anchor.BN(1)) .accounts({ signer: voter, }) .instruction(); const blockhash = await connection.getLatestBlockhash(); const transaction = new Transaction({ feePayer: voter, blockhash: blockhash.blockhash, lastValidBlockHeight: blockhash.lastValidBlockHeight, }).add(instruction); const response = await createPostResponse({ fields: { transaction: transaction, type: 'transaction', }, }); return Response.json(response, { headers: ACTIONS_CORS_HEADERS });
} Now let's test our Blink. If you already have the Blink open on dial.to, simply refresh it, otherwise use the link https://dial.to/?action=solana-action:http://localhost:3000/api/votingdapp to open your Blink. If you run locally, there is going to be a lot of information shown inside your wallet floating window. What you find usually with wallets if that they are not doing anything like caching on local, they are just just skipping it. We can just confirm it because we know that we are working on local. Oftentimes, if you do see errors though, it is advised that you do not confirm your transaction just as a general FYI. We previously deployed our program / smart contract onto our local test validator and we don't actually have any information about this smart contract or polls or candidates, so we actually have to create them. A very easy way to create those is you can just run your test. And if you write your test correctly, which we did earlier, this should be able to create the correct candidates of Smooth and Crunchy for people to vote on. So let us go ahead and run a test to create actual Smooth and Crunchy candidates real quick using $ anchor test --skip-local-validator. This command will deploy to our local test validator and then run all of our test. And it should set up our specific poll onto our local validator. In case you encounter errors while trying to run test; Update your new PublicKey() string value inside your votingdapp.spec.ts with the generated Program Id shown inside your terminal. You can also obtain the correct Program Id by running command $ anchor keys list inside your terminal. Set up your poll and candidate ID configuration inside your votingdapp.spec.ts in order to create votes. In order to configure our candidate poll and ID, we'll make the following updates to your votingdapp.spec.ts code: import * as anchor from '@coral-xyz/anchor';
import { Program } from '@coral-xyz/anchor';
import { Keypair, PublicKey } from '@solana/web3.js';
import { Votingdapp } from '../target/types/votingdapp';
import { startAnchor } from 'solana-bankrun';
import { BankrunProvider } from 'anchor-bankrun'; const IDL = require('../target/idl/votingdapp.json'); /*const votingdappAddress = new PublicKey( 'AsjZ3kWAUSQRNt2pZVeJkywhZ6gpLpHZmJjduPmKZDZZ'
);*/
const votingdappAddress = new PublicKey( 'ARCa2n7p7CFanHpEDhygY5i9o1Jbqwr87qmFkncTJQ49'
); describe('votingdapp', () => { let context; let provider; anchor.setProvider(anchor.AnchorProvider.env()); //let votingdappProgram: Program<Votingdapp>; let votingdappProgram = anchor.workspace.Votingdapp as Program<Votingdapp>; /*beforeAll(async () => { context = await startAnchor( '', [{ name: 'votingdapp', programId: votingdappAddress }], [] ); provider = new BankrunProvider(context); votingdappProgram = new Program<Votingdapp>(IDL, provider); });*/ // Test 1: it('Initialize Poll', async () => { await votingdappProgram.methods .initializePoll( new anchor.BN(1), 'What is your favorite type of peanut butter', new anchor.BN(0), new anchor.BN(1821246680) ) .rpc(); const [pollAddress] = PublicKey.findProgramAddressSync( // Grab the buffer from a u64 [new anchor.BN(1).toArrayLike(Buffer, 'le', 8)], votingdappAddress ); const poll = await votingdappProgram.account.poll.fetch(pollAddress); console.log(poll); expect(poll.pollId.toNumber()).toEqual(1); expect(poll.description).toEqual( 'What is your favorite type of peanut butter' ); expect(poll.pollStart.toNumber()).toBeLessThan(poll.pollEnd.toNumber()); }); // Test 2: it('Initialize Candidate', async () => { await votingdappProgram.methods .initializeCandidate('Smooth', new anchor.BN(1)) .rpc(); await votingdappProgram.methods .initializeCandidate('Crunchy', new anchor.BN(1)) .rpc(); const [crunchyAddress] = PublicKey.findProgramAddressSync( [new anchor.BN(1).toArrayLike(Buffer, 'le', 8), Buffer.from('Crunchy')], votingdappAddress ); const crunchyCandidate = await votingdappProgram.account.candidate.fetch( crunchyAddress ); console.log(crunchyCandidate); expect(crunchyCandidate.candidateVotes.toNumber()).toEqual(0); const [smoothAddress] = PublicKey.findProgramAddressSync( [new anchor.BN(1).toArrayLike(Buffer, 'le', 8), Buffer.from('Smooth')], votingdappAddress ); const smoothCandidate = await votingdappProgram.account.candidate.fetch( smoothAddress ); console.log(smoothCandidate); expect(smoothCandidate.candidateVotes.toNumber()).toEqual(0); }); // Test 3: it('vote', async () => { await votingdappProgram.methods.vote('Smooth', new anchor.BN(1)).rpc(); const [smoothAddress] = PublicKey.findProgramAddressSync( [new anchor.BN(1).toArrayLike(Buffer, 'le', 8), Buffer.from('Smooth')], votingdappAddress ); const smoothCandidate = await votingdappProgram.account.candidate.fetch( smoothAddress ); console.log(smoothCandidate); expect(smoothCandidate.candidateVotes.toNumber()).toEqual(1); });
}); Run $ anchor clean inside your terminal to cleanup your workspace and ensure that everything is set up for success. This command will delete file(s) inside your /anchor/target/idl and /anchor/target/types. No, worries, you will regain updated versions of them when you build or test your program. Run the command $ anchor keys list inside your terminal and copy the new public key. Go into your /anchor/Anchor.toml file and replace the value of votingdapp with your copied new public key. Also go into your /anchor/programs/src/lib.rs file and replace the string value of declare_id!() with your copied new public key. Delete existing /anchor/test-ledger folder. Optionally copy and paste the most recent and up-to-date .so binary of your program from /anchor/target/deploy/votingdapp.so to the /anchor/tests/fixtures folder. Finally, rerun $ anchor test --skip-local-validator. Upon subsequent new tests run $ anchor test --skip-local-validator --skip-deploy. Congratulations, you have completed this chapter! Use the Solana Explorer https://explorer.solana.com/ pointing it at your localhost to view your Votingdapp's transaction history. Now if you wanted to take this specific Blink to production, you would have to go through the registry and register it. And it is also recommended that you deploy this to an actual environment, maybe Devnet or even Mainnet. And that way, other people can interact with it via whatever social network they please. Chapter Recap: Extracted Voting Dapp code Created server-side component via nextjs to serve the Actions and allow people to get the serialized transactions. Viewed and tested a Blink via dial.to Timestamp - [1:51:56 - 02:31:43]

